# generated by configure / remove this line to disable regeneration
prefix="/usr"
exec_prefix="${prefix}"
bindir="${exec_prefix}/bin"
libdir="/usr/src/isl/isl/.libs"
datarootdir="${prefix}/share"
datadir="${datarootdir}"
sysconfdir="${prefix}/etc"
includedir="/usr/src/isl/isl/./include"
package="isl"
suffix=""

for option; do case "$option" in --list-all|--name) echo  "isl"
;; --help) pkg-config --help ; echo Buildscript Of "isl Library"
;; --modversion|--version) echo "0.11.2"
;; --requires) echo : ""
;; --libs) echo -L${libdir} "" "-lisl -lgmp"
       :
;; --cflags) echo -I${includedir} ""
       :
;; --variable=*) eval echo '$'`echo $option | sed -e 's/.*=//'`
;; --uninstalled) exit 0 
;; *) ;; esac done
